#include <iostream>
#include <vector>
#include <string>
#include <algorithm>

using namespace std;

void solve() {
    int t[6];
    for (int i = 0; i < 6; i++) {
        cin >> t[i];
    }
    int p, q;
    cin >> p >> q;
    int n = t[0] + t[1] + t[2] + t[3] + t[4] + t[5];
    if (p > q) {
        cout << "impossible" << endl;
        return;
    }
    vector<string> ans;
    for (int i = 0; i < n; i++) {
        ans.push_back("N");
    }
    for (int i = 0; i < n; i++) {
        ans.push_back("S");
    }
    for (int i = 0; i < n; i++) {
        ans.push_back("E");
    }
    for (int i = 0; i < n; i++) {
        ans.push_back("W");
    }
    vector<string> res;
    for (int i = 0; i < n; i++) {
        if (t[0] == 0) {
            res.push_back(ans[i]);
        } else {
            if (t[0] == 1) {
                if (ans[i] == "N") {
                    res.push_back("E");
                } else if (ans[i] == "E") {
                    res.push_back("S");
                } else if (ans[i] == "S") {
                    res.push_back("W");
                } else {
                    res.push_back("N");
                }
            } else {
                if (t[0] == 2) {
                    if (ans[i] == "N") {
                        res.push_back("E");
                    } else if (ans[i] == "E") {
                        res.push_back("W");
                    } else if (ans[i] == "S") {
                        res.push_back("E");
                    } else {
                        res.push_back("S");
                    }
                } else {
                    if (t[0] == 3) {
                        if (ans[i] == "N") {
                            res.push_back("W");
                        } else if (ans[i] == "E") {
                            res.push_back("N");
                        } else if (ans[i] == "S") {
                            res.push_back("W");
                        } else {
                            res.push_back("E");
                        }
                    } else {
                        if (t[0] == 4) {
                            if (ans[i] == "N") {
                                res.push_back("W");
                            } else if (ans[i] == "E") {
                                res.push_back("S");
                            } else if (ans[i] == "S") {
                                res.push_back("N");
                            } else {
                                res.push_back("E");
                            }
                        } else {
                            if (t[0] == 5) {
                                if (ans[i] == "N") {
                                    res.push_back("W");
                                } else if (ans[i] == "E") {
                                    res.push_back("N");
                                } else if (ans[i] == "S") {
                                    res.push_back("E");
                                } else {
                                    res.push_back("S");
                                }
                            }
                        }
                    }
                }
            }
            t[0]--;
            t[1]--;
            t[2]--;
            t[3]--;
            t[4]--;
            t[5]--;
        }
    }
    string res_str;
    for (int i = 0; i < n; i++) {
        res_str += res[i];
    }
    string temp = res_str;
    sort(temp.begin(), temp.end());
    if (res_str != temp) {
        cout << "impossible" << endl;
        return;
    }
    string ans_str = "";
    for (int i = p - 1; i < q; i++) {
        ans_str += res[i];
    }
    cout << ans_str << endl;
}

int main() {
    int T;
    cin >> T;
    while (T--) {
        solve();
    }
    return 0;
}
